import { playSongByInput, queueSong, playNextSong } from "./video-controller";
import { QUEUE,PLAY_NEXT, PLAY_NOW } from "../../constants/constants";

export const mappedController = {
  [QUEUE]: playSongByInput,
  [PLAY_NEXT]: queueSong,
  [PLAY_NOW]: playNextSong
}
